int Matf64_InverseGeneric(double *outmat, double *mat, int n)
{
	int i, j, k, p;
	double f, g, tol;

	f = 0.0f;
	for (i = 0; i < n; i++) 
	{
		for (j = 0; j < n; j++) 
		{
			g = mat[j+i*n];
			f += g * g;
		}
	}
	f = sqrt(f);

	tol = f * 2.2204460492503131e-016;

	for (i = 0; i < n; i++) 
		for (j = 0; j < n; j++) 
			outmat[j+i*n] = (i == j) ? 1.0 : 0.0;

	for (k = 0; k < n; k++) 
	{
		f = fabs(mat[k+k*n]);
		p = k;
		for (i = k+1; i < n; i++) 
		{
			g = fabs(mat[k+i*n]);
			if (g > f)
			{
				f = g;
				p = i;
			}
		}
		if (f < tol) 
			return 1;
		if (p != k) 
		{
			for (j = k; j < n; j++) 
			{
				f = mat[j+k*n];
				mat[j+k*n] = mat[j+p*n];
				mat[j+p*n] = f;
			}
			for (j = 0; j < n; j++) 
			{
				f = outmat[j+k*n];
				outmat[j+k*n] = outmat[j+p*n];
				outmat[j+p*n] = f;
			}
		}
		f = 1.0f / mat[k+k*n];

		for (j = k; j < n; j++) 
			mat[j+k*n] *= f;
		for (j = 0; j < n; j++) 
			outmat[j+k*n] *= f;
		for (i = 0; i < n; i++) 
		{
			if (i == k) 
				continue;

			f = mat[k+i*n];

			for (j = k; j < n; j++) 
				mat[j+i*n] -= mat[j+k*n] * f;
			for (j = 0; j < n; j++) 
				outmat[j+i*n] -= outmat[j+k*n] * f;
		}
	}
	return 0;
}
double Matf64_UpperTriangularGeneric(double *m, int n)
{
	double sign = G_F64_ONE;
	int col;
	int row;
	int i;
	int j;

	for (i = 0; i < n; i++) 
	{
		int k;
		double f;
		int p;
		double g;

		f = fabs(m[i+i*n]);
		p = i;
		for (k = i+1; k < n; k++) 
		{
			g = fabs(m[i+k*n]);
			if (g > f)
			{
				f = g;
				p = k;
			}
		}
		if (p != i) 
		{
			sign = -sign;
			for (j = i; j < n; j++) 
			{
				f = m[j+i*n];
				m[j+i*n] = m[j+p*n];
				m[j+p*n] = f;
			}
		}

		if (m[i*n + i] == G_F64_ZERO)
			return G_F64_ZERO;

		for (row = i + 1; row < n; row++) 
		{
			double scale = m[row*n + i] / m[i*n + i];

			if (scale == G_F64_ZERO)	
				continue;

			for (col = i; col < n; col ++)
				m[row*n + col] -= m[i*n + col] * scale;
		}
	}
	return sign;
}
