mat2x2f64_t Mat2x2f64_Mat(double x0y0, double x1y0, double x0y1, double x1y1)
{
	mat2x2f64_t m;

	m.v[0].v[0] = x0y0;
	m.v[0].v[1] = x1y0;
	m.v[1].v[0] = x0y1;
	m.v[1].v[1] = x1y1;

	return m;
}
mat2x2f64_t Mat2x2f64_Inverse(mat2x2f64_t mat, int *is_singular)
{
	mat2x2f64_t outmat;
	*is_singular = Matf64_InverseGeneric((double*)&outmat, (double*)&mat, 2);
	return outmat;
}
