mat2x7i8_t Mat3x8i8_DeleteRowColumn(mat3x8i8_t mat, int row, int column)
{
	int x;
	int y;
	int dx;
	int dy;
	mat2x7i8_t outmat;

	for (y = 0, dy = 0; y < 8; y++)
	{
		if (y == row)
			continue;
		for (x = 0, dx = 0; x < 3; x++)
		{
			if (x == column)
				continue;
			outmat.v[dy].v[dx] = mat.v[y].v[x];
			dx++;
		}
		dy++;
	}

	return outmat;
}
