mat4x2f64_t Mat5x3f64_DeleteRowColumn(mat5x3f64_t mat, int row, int column)
{
	int x;
	int y;
	int dx;
	int dy;
	mat4x2f64_t outmat;

	for (y = 0, dy = 0; y < 3; y++)
	{
		if (y == row)
			continue;
		for (x = 0, dx = 0; x < 5; x++)
		{
			if (x == column)
				continue;
			outmat.v[dy].v[dx] = mat.v[y].v[x];
			dx++;
		}
		dy++;
	}

	return outmat;
}
