mat7x2f64_t Mat8x3f64_DeleteRowColumn(mat8x3f64_t mat, int row, int column)
{
	int x;
	int y;
	int dx;
	int dy;
	mat7x2f64_t outmat;

	for (y = 0, dy = 0; y < 3; y++)
	{
		if (y == row)
			continue;
		for (x = 0, dx = 0; x < 8; x++)
		{
			if (x == column)
				continue;
			outmat.v[dy].v[dx] = mat.v[y].v[x];
			dx++;
		}
		dy++;
	}

	return outmat;
}
